import React from 'react';
import ShopAllPreview from '../../components/shop-all/Shop-all-preview.component';
import ShopAllMenu from '../../components/shop-all-menu/shop-all-menu.component';
import './shop-all.style.css';

const ShopAllPreviewPage =() => (
    <div className='shop-all-page-container'>
        <ShopAllMenu />
        <ShopAllPreview />
    </div>
);

export default ShopAllPreviewPage;
